import { Layout } from "../components/Layout";
import axios from "axios";
import { Component } from "react";
import Table from "react-bootstrap/Table";
export default class Payments extends Component {
  static async getInitialProps() {
    const res = await axios.get("http://0.0.0.0:8000/api/payments/");
    const data = await res.data;
    console.log(data);
    return { students: data };
  }

  render() {
    return (
      <Layout title="Payments">
        <Table striped bordered hover responsive>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Country</th>
              <th>City</th>
              <th>Type Payment</th>
              <th>Due</th>
            </tr>
          </thead>
          <tbody>
            {props.students.map(student => {
              return (
                <tr key={student.id}>
                  <td className="d-none d-sm-table-cell">
                    <Link>{student.name}</Link>
                  </td>
                  <td className="d-none d-sm-table-cell">{card.team_name}</td>
                  <td className="d-none d-sm-table-cell">
                    {card.category_name}
                  </td>
                  <td className="d-none d-sm-table-cell">
                    {card.subcategory_name}
                  </td>
                  <td className="d-none d-sm-table-cell">
                    {card.date_start} a {card.date_end}
                  </td>
                  <td className="d-none d-sm-table-cell">
                    {ReactHtmlParser(card.description)}
                  </td>
                  <td className="d-none d-sm-table-cell text-center">
                    <Link to="#">
                      <i className="ti-time"></i>
                    </Link>
                  </td>
                  <td className="d-none d-sm-table-cell text-center">
                    <Link to="#">
                      <i className="ti-reload"></i>
                    </Link>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </Table>
      </Layout>
    );
  }
}
